B.QV=new A.aS(63405,"MaterialIcons",null,!1)
B.agY=new A.k8(B.QV,"1. Penerimaan Persyaratan",'Dengan mengunduh, mengakses, atau menggunakan aplikasi LES MANIA ("Aplikasi"), Anda setuju untuk terikat oleh Syarat dan Ketentuan ini ("Syarat"). Jika Anda tidak menyetujui Syarat ini, Anda tidak diizinkan untuk menggunakan Aplikasi.')
B.QW=new A.aS(63681,"MaterialIcons",null,!1)
B.agZ=new A.k8(B.QW,"2. Deskripsi Layanan",'LES MANIA adalah platform yang menghubungkan calon siswa atau orang tua murid ("Pengguna") dengan penyedia jasa les privat ("Guru"). Peran kami adalah sebagai perantara untuk memfasilitasi pertemuan antara Pengguna dan Guru. Kami tidak mempekerjakan Guru secara langsung dan tidak bertanggung jawab atas metode pengajaran atau interaksi yang terjadi di luar platform.')
B.QY=new A.aS(983325,"MaterialIcons",null,!1)
B.ah_=new A.k8(B.QY,"3. Kewajiban Pengguna","Anda setuju untuk:\na. Memberikan informasi yang akurat, terkini, dan lengkap saat melakukan pendaftaran atau pencarian.\nb. Menjaga kerahasiaan informasi akun Anda.\nc. Berkomunikasi dengan Guru secara sopan dan profesional.\nd. Tidak menggunakan aplikasi untuk tujuan yang melanggar hukum, menipu, atau merugikan pihak lain.")
B.QX=new A.aS(983127,"MaterialIcons",null,!1)
B.ah3=new A.k8(B.QX,"4. Pembayaran Jasa Guru","Semua transaksi pembayaran untuk jasa les privat dilakukan secara langsung antara Pengguna dan Guru berdasarkan kesepakatan kedua belah pihak. LES MANIA tidak terlibat dalam proses transaksi dan tidak bertanggung jawab atas perselisihan pembayaran apa pun.")
B.QZ=new A.aS(983358,"MaterialIcons",null,!1)
B.ah1=new A.k8(B.QZ,"5. Pembatasan Tanggung Jawab",'LES MANIA menyediakan platform "sebagaimana adanya". Meskipun kami berupaya melakukan verifikasi dasar terhadap profil Guru, kami tidak menjamin kualitas, keamanan, atau legalitas jasa yang ditawarkan. Interaksi dan kesepakatan apa pun yang Anda buat dengan Guru adalah sepenuhnya menjadi risiko dan tanggung jawab Anda sendiri.')
B.QT=new A.aS(63020,"MaterialIcons",null,!1)
B.ah0=new A.k8(B.QT,"6. Perubahan Syarat","Kami dapat mengubah Syarat ini dari waktu ke waktu. Jika ada perubahan, kami akan memberitahukannya melalui notifikasi di aplikasi atau cara lain yang wajar. Dengan terus menggunakan Aplikasi setelah perubahan, Anda dianggap menyetujui Syarat yang baru.")
B.QU=new A.aS(63078,"MaterialIcons",null,!1)
B.ah2=new A.k8(B.QU,"7. Kontak Kami","Jika Anda memiliki pertanyaan mengenai Syarat dan Ketentuan ini, silakan hubungi kami melalui email di: kontak@lesmania.com")
